import React, {useState, useEffect} from 'react';
import PageDefault from '../../components/pageDefault';
import {Container, Row, Column} from '../../components/grid';

function Home(){

    return(
        <PageDefault>
            <Container>
                <Row>
                   <Column grid='3'>
                        <a href="https://github.com/Worell97/Oscar/blob/d64379a07c66590f0f093a875f6cd106b658cf2d/src/assets/Perfil.png" alt="Picture"></a>Left side bar</Column> 
                   <Column grid='7'>Content</Column> 
                   <Column grid='2'>Something else</Column> 
                </Row>
            </Container>                   
        </PageDefault>
    );
}

export default Home;
